export class Organization {
  constructor(id, name, organizationType, logoContentType, logo, active, activeOwner, description, address, motto, phone, webAddress, placeNumber, price, rentType, rentable, images, organizationReservations, user, restaurant, hotel, club, building, tags) {
    this.id = id;
    this.name = name;
    this.organizationType = organizationType;
    this.logoContentType = logoContentType;
    this.logo = logo;
    this.active = active;
    this.activeOwner = activeOwner;
    this.description = description;
    this.address = address;
    this.motto = motto;
    this.phone = phone;
    this.webAddress = webAddress;
    this.placeNumber = placeNumber;
    this.price = price;
    this.rentType = rentType;
    this.rentable = rentable;
    this.images = images;
    this.organizationReservations = organizationReservations;
    this.user = user;
    this.restaurant = restaurant;
    this.hotel = hotel;
    this.club = club;
    this.building = building;
    this.tags = tags;
    this.active = this.active ?? false;
    this.activeOwner = this.activeOwner ?? false;
    this.rentable = this.rentable ?? false;
  }
}
export function getOrganizationIdentifier(organization) {
  return organization.id;
}
